import React, {useState} from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
// import Navbar from './Navbar';
import HomeContainer from './HomeContainer';
import Blog from './Blog';
import Experiences from './Experiences';
import Console from './Console';
import me from './mee.jpg';
import './App.css';
import Navbar from './Navbar';
import ConsoleWindow from './Console';
import linkedin from './linkedin.svg'
import gmail from './gmail.svg';
import copyright from './copyright.svg';
function App() {
  const [isHovered, setIsHovered] = useState(false);

  const toggleGrayscale = () => {
    setIsHovered(!isHovered);
  };

  const imageStyle = {
    filter: isHovered ? 'grayscale(0%)' : 'grayscale(100%)',
    transition: 'filter 0.3s ease',
  };

  return (
    <div className="App">
    <div className="overflow-x-hidden">
      <div className="flex justify-between">
        <div className="w-72 mt-4">
          <Navbar />
          <p className="mt-10">Hi there, Shubhada here</p>
        </div>
        <div className="w-1/4 flex flex-col border-l border-gray-300">
          {/* Other content */}
        </div>
      </div>
    </div>
    <div className="fixed top-0 left-0 right-0 bottom-0 flex justify-center items-center min-h-screen">
      <div
        className="ml-7"
        onMouseEnter={toggleGrayscale}
        onMouseLeave={toggleGrayscale}
        style={imageStyle}
      >
        <img src={me} alt="Image" />
      </div>
    </div>
    <div className="fixed bottom-5 left-5 flex items-center">
      <div className="flex items-center">
        <p>&copy; 2023 by Shubhada Mohite</p>
      </div>
      <div className="fixed bottom-5 right-5 flex mr-85">
        <img src={linkedin} className="ml-3 w-6" alt="linkedin" />
        <img src={gmail} className="ml-3 w-6" alt="gmail" />
      </div>
    </div>
  </div>
);
}


